import React, { useMemo } from "react";

const Student = (props) => {
  const {
    city,
    company,
    email,
    firstName,
    grades,
    id,
    lastName,
    pic,
    skill,
  } = props.info;

  const average = useMemo(() => {
    let average = 0;
    for (const grade of grades) {
      average += parseInt(grade, 10);
    }
    return average / grades.length;
  }, [grades]);

  console.log(props.info);
  return (
    <div>
      <img />
      <p>
        {firstName} {lastName}
      </p>
      <p>Email: {email}</p>
      <p>Company: {company}</p>
      <p>Skill: {skill}</p>
      <p>Average: {average}%</p>
    </div>
  );
};

export default Student;
